            );
        }

        // GPX 데이터를 파싱하는 함수
        function parseGPX(gpxData) {
            var parser = new DOMParser();
            var xmlDoc = parser.parseFromString(gpxData, "application/xml");
            var trkpts = xmlDoc.getElementsByTagName('trkpt');
            var path = [];

            // 경로 데이터를 LatLng 배열로 변환
            for (var i = 0; i < trkpts.length; i++) {
                var lat = parseFloat(trkpts[i].getAttribute('lat'));
                var lon = parseFloat(trkpts[i].getAttribute('lon'));
                path.push(new kakao.maps.LatLng(lat, lon));
            }

            return path;

        var polyline = new kakao.maps.Polyline({
            path: path, // 경로
            strokeWeight: 4, // 선 두께
            strokeColor: '#0000FF', // 선 색깔 #0000FF는 파란색, #FF0000은 빨간색

            strokeStyle: 'solid' // 선 스타일
        });

        // 경로 지도에 표시
        polyline.setMap(map);

        // 마커 위치와 정보 데이터
        var positions = [
            { lat: 37.475070607250316, lon: 126.64493237781842, memo: "(송림동)해장국집" },
            { lat: 37.475631855098, lon: 126.61971623735018, memo: "연경" },
            { lat: 37.45243517663534, lon: 126.63244644207633, memo: "스타벅스" },

        ];

        // 마커 배열
        var markers = [];

        // 각 위치에 마커 생성
        positions.forEach(function(position) {
            var marker = new kakao.maps.Marker({
                position: new kakao.maps.LatLng(position.lat, position.lon),
                image: createCircleIcon() // 동그라미 모양 마커 아이콘
            });

            // 마커 클릭 시 메모(InfoWindow) 표시 및 토글 기능 구현
            var infoWindow = new kakao.maps.InfoWindow({
                content: `<div style="padding:5px; font-size: 12px;">${position.memo}</div>`,
                removable: true // 닫기 버튼 추가
            });

            var isOpen = false; // InfoWindow 열림 상태 추적

            // 마커 클릭 시 토글로 메모 열기/닫기
            kakao.maps.event.addListener(marker, 'click', function() {
                if (isOpen) {
                    infoWindow.close();
                } else {
                    infoWindow.open(map, marker);
                }
                isOpen = !isOpen;
            });

            markers.push(marker);
        });

        // 마커 클러스터러 설정
        var clusterer = new kakao.maps.MarkerClusterer({
            map: map,
            averageCenter: true, // 클러스터링 시 중앙을 평균으로
            minLevel: 7 // 클러스터링이 적용되는 최소 줌 레벨
        });

        // 클러스터러에 마커 추가
        clusterer.addMarkers(markers);

            // 지도 중심과 확대 수준 설정
    var mapContainer = document.getElementById('map');
    var mapOption = {

    };
    var map = new kakao.maps.Map(mapContainer, mapOption);

    // 팝업창의 위치 및 내용 설정
    var popupPosition = new kakao.maps.LatLng(37.41020233137107, 126.6796163126106); // 팝업이 띄워질 위치

    // 팝업창 내용 (여기에 텍스트를 HTML로 작성)
    var content = `
        <div class="popup">

            <p>이곳은 서울특별시의 중심에 위치한 지도입니다. 여기에 원하는 정보를 추가할 수 있습니다.</p>

                <li><strong>위치</strong>: 서울특별시</li>
                <li><strong>설명</strong>: 이 지도는 카카오맵을 이용해 제작되었습니다.</li>
                <li><strong>기타 정보</strong>: 더 많은 정보는 여기에서 확인하실 수 있습니다.</li>
            </ul>
            <button id="closePopupBtn">닫기</button>
        </div>
    `;

    // 팝업창 생성
    var infoWindow = new kakao.maps.InfoWindow({
        position: popupPosition,  // 팝업 위치 설정
        content: content, // 팝업 내용 설정
        removable: true  // 닫기 버튼 자동 제공
    });

    // 팝업창을 기본적으로 열어두기
    infoWindow.open(map);

    // 팝업창 닫기 버튼 클릭 시 팝업창 닫히게 설정
    document.getElementById("closePopupBtn").addEventListener("click", function() {
        infoWindow.close();  // 팝업창 닫기
    });
